// src/App.js
import React from 'react';
import { Link, Route, BrowserRouter as Router, Switch } from 'react-router-dom';
import Cartoon from './components/Cartoon';
import English from './components/English';
import Hindi from './components/Hindi';
import Home from './components/Home';
import Tamil from './components/Tamil';
import './index.css';

function App() {
  return (
    <Router>
      <div>
        <header>
          <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/tamil">Tamil</Link></li>
              <li><Link to="/english">English</Link></li>
              <li><Link to="/hindi">Hindi</Link></li>
              <li><Link to="/cartoon">Cartoon</Link></li>
            </ul>
          </nav>
        </header>
        <main>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/tamil" component={Tamil} />
            <Route path="/english" component={English} />
            <Route path="/hindi" component={Hindi} />
            <Route path="/cartoon" component={Cartoon} />
          </Switch>
        </main>
      </div>
    </Router>
  );
}

export default App;
